import React from "react";

const Card = ({ image, name, temperaments, weight }) => {
  return (
    <div>
      <img src={image} alt="img not found" width="200px" height="250px" />
      <h3>{name}</h3>
      <h3>{weight + " kilos"}</h3>

      <h3>{temperaments.map((temp) => `${temp.name}`).join(", ")}</h3>
    </div>
  );
};

export default Card;
